import CalendarStore from './calendarStore'
import AuthStore from './authStore'
import CartStore from './cartStore'

const headerStore = new CalendarStore();
const authStore = new AuthStore();
const cartStore = new CartStore();


export {
    headerStore,
    authStore,
    cartStore
}
